import './Section2.css';


function Section2() {
    return (
        <div className="section2-container">
            <h1>Explore some of the Sustainability Metrics</h1>
            <div className="section2-content">
                <img src="Frame.png" />
                <img src="Content.png" />
                <img src="Frame2.png" />
            </div>
        </div>
    )
}

export default Section2
